import React, { useState } from 'react';
import FileStructure from './FileStructure';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheckCircle, faCog, faList, faFileAlt, faChartBar } from '@fortawesome/free-solid-svg-icons';


function HomePage() {
    const [showDiv, setShowDiv] = useState(false);

    const handleClick = () => {
        setShowDiv(true);
    };

    const palatteIcon = ({srcName}) => {
        return(
            <div className='palatte-icon'>
                <img src={srcName}></img>
                <hr/>
            </div>
        );
    }

    const divStyle = {
        display: showDiv ? 'block' : 'none',
        backgroundColor: '#f0f0f0',
        padding: '20px',
        marginTop: '20px',
    };

    return (
        <>
            <div>
                <p className="top-text">Job</p>
                <div className="parent">
                    <div className="palatte-area">
                    <FileStructure />
                    </div>
                    <div className='content-area'>
                        <div className='icons'>
                        </div>
                        <div className='task'>
                            <button>1</button>
                            <button>2</button>
                            <button>3</button>
                            <button>4</button>
                            <button>5</button>
                        </div>
                    </div>
                </div>
            </div>

        </>  
    );
}

export default HomePage;
